--
-- Estructura para la vista `info_grades`
--
DROP TABLE IF EXISTS `info_grades`;

CREATE ALGORITHM=UNDEFINED DEFINER=`siaefi3`@`%` SQL SECURITY DEFINER VIEW `info_grades` AS select `a`.`id` AS `assigment_id`,`g`.`id` AS `grade_id`,`s`.`id` AS `student_id`,`a`.`name` AS `name`,`g`.`value` AS `value`,`w`.`weight` AS `weight` from (((`grades` `g` join `students` `s` on((`s`.`id` = `g`.`student_id`))) join `assignments` `a` on((`a`.`id` = `g`.`assigment_id`))) join `weights` `w` on((`w`.`id` = `a`.`weight_id`)));

-- --------------------------------------------------------

--
-- Estructura para la vista `info_groups`
--
DROP TABLE IF EXISTS `info_groups`;

CREATE ALGORITHM=UNDEFINED DEFINER=`siaefi3`@`%` SQL SECURITY DEFINER VIEW `info_groups` AS select `g`.`id` AS `group_id`,`c`.`name` AS `name`,concat(`p`.`names`,' ',`p`.`paternal_surname`,' ',`p`.`maternal_surname`) AS `full_name`,`p`.`email` AS `email`,`g`.`classroom` AS `classroom`,`c`.`code` AS `code`,`c`.`credits` AS `credits`,`g`.`group_number` AS `group_number`,`g`.`class_schedule` AS `class_schedule`,`s`.`name` AS `semester` from (((`groups` `g` join `professors` `p` on((`p`.`id` = `g`.`professor_id`))) join `courses` `c` on((`c`.`id` = `g`.`course_id`))) join `semesters` `s` on((`s`.`id` = `g`.`semester_id`)));

-- --------------------------------------------------------

--
-- Estructura para la vista `info_materials`
